import React from "react";
import { Parallax } from "react-scroll-parallax";

export default function Wildlife(){
    return <div className='w-full relative -z-10'>
        <img src={require('../assets/images/dark-green.jpg')} alt="" />
        <div className='absolute inset-x-0  top-0 w-full h-3/4 bg-gradient-to-b from-black to-transparent z-10'></div>
        <div className='absolute inset-x-0 bottom-0 w-full h-1/4 bg-gradient-to-t from-black to-transparent z-10'></div>
        <Parallax
            speed= {100}
            translateY = {[0, 290,]}
            translateX= {[0, -3,]}
            
            scale = {[0.85, 1]}

            // translateX={["-20px", "0px"]}
            // scale={[1, 1.25]}
            // endScroll={0}
            // startScroll={0}
        >
            <div className='absolute bottom-0 right-20 z-20 w-[500px] grayscale '>
                <img src={require('../assets/images/jaguar.png')} />
            </div>
        </Parallax>
        <Parallax>
            <div className='absolute bottom-0 right-0 z-30 w-[800px]'>
                {/* <img src={require('../assets/images/bottom-leaf.png')} /> */}
            </div>
        </Parallax>
    </div>
}
